.dandelion{ position: absolute; height:70px; width:60px; overflow:hidden; left:0px; top:0px;}
.dandelion_fluff{ height:40px; width:60px; position:absolute; left:1px; top:4px;}
.dandelion_fluff_inner{display:block; height:20px; width:30px; border-bottom:1px solid rgba(255,255,255,0.6); border-radius:30px 30px 10px 40px/25px 20px 5px 15px; position:absolute; -moz-transform-origin:100% 100%;}
.dandelion_fluff_inner:after{content:""; display:block; height:20px; width:30px; border-bottom:1px solid rgba(255,255,255,0.3); border-radius:30px 30px 20px 40px/25px 20px 5px 20px; position:absolute; left:0px; top:0px; -moz-transform-origin:100% 100%; -moz-transform:rotate(-10deg);}
.dandelion_fluff_inner:before{content:""; display:block; height:20px; width:30px; border-bottom:1px solid rgba(255,255,255,0.2); border-radius:30px 30px 20px 40px/25px 20px 5px 20px; position:absolute; left:0px; top:0px; -moz-transform-origin:100% 100%; -moz-transform:rotate(-18deg);}

.dandelion_stem{ height:30px; width:1px; background: -moz-linear-gradient(top,rgba(225,219,203,0.6),rgba(201,183,136,0.8)); position: absolute; top:24px; left:31px;}

.dandelion_seed{ height:16px; width:3px; background: -moz-linear-gradient(top,#46384e,#1c1a1f); border-radius:8px/50px; position:absolute; top:54px; left:30px; overflow:hidden;}
